import React from 'react'
import ReactDOM from 'react-dom';
import './main.css'
let use={

};
class Login extends React.Component{
  constructor(){
    super()
    this.state={text:""};
    this.update=this.update.bind(this);
    this.show=this.show.bind(this)
    this.setref=React.createRef();

  }
  componentDidMount(){
    alert(1)
    this.setref.current.focus()
  }
  update(e){
    this.setState({text:e.target.value})
    use.username=e.target.value;
  }
  show(){
    let data={
      method:'POST',
      body:JSON.stringify(use),
      headers: {'Content-Type':'application/json'},
    }
     fetch("http://localhost:8000/post",data)


  }
  render(){
    return(
    <div className='Login' ref={this.setref}>
      <lable htmlFor="Username">Username</lable>
      <input className='Username' onKeyUp={this.update}/><br></br>
      <br></br>
      <Password/>
      <br></br>
      <button onClick={this.show}>Submit</button>
    </div>)
  }
}
class Password extends React.Component{
  constructor(){
    super()
    this.state={text:''};
    this.update=this.update.bind(this);
  }
  update(e){
    this.setState({text:e.target.value});
    use.password=e.target.value;
  }
  render(){
    return(<>
      <label htmlFor='Password'>Password</label>
      <input className='Password' onKeyUp={this.update} />
      </>
    )
  }
}
ReactDOM.render(<Login/>,document.getElementById('root'));
